var startY = 0;
function start() {
  background('black');
  //fill('black');
  //stroke('white');
  //strokeWeight(20)
  //square(0, 0, 300);
  
  fill('white');
  strokeWeight(0)
  textSize(32);
  text("DigiPong", 150, startY);
  startY += (startY < 100) ? 1.5 : 0;

  if (startY > 100) {
    if (millis() % 2000 > 1000) {
      textSize(15);
      text("PRESS S\nTO START", 150, 180);
    } else {
      textSize(15);
      text("PRESS I\nFOR INSTRUCTIONS", 150, 180);
    }
    image(img.digiasset[0], 125, 220)
    
    if (keyIsDown(83)) {
      gameState = 'game'
      startY = 0
    } else if (keyIsDown(73)) {
      gameState = 'instructions'
      startY = 0
    }
  }   
}

var gameData = {
  py: 155,
  my: 155,
  pp: 0,
  mp: 0,
  bx: 150,
  by: 165,
  dx: Random(0, 2) == 1? 1 : -1,
  dy: Math.random() * (Random(0, 2) == 0 ? -1 : 1)
}
function game() {
  background('black');
  textSize(15)
  strokeWeight(0);
  fill('white');
  text("Player 1", 75, 50)
  text("Player 2", 225, 50)
  text(gameData.pp, 75, 70)
  text(gameData.mp, 225, 70)
  text("get 10 points", 150, 280)
  
  // Draw box
  drawingContext.setLineDash([]);
  fill('black');
  stroke('white');
  strokeWeight(3);
  rect(10, 90, 280, 150)
  
  // Draw middle line
  drawingContext.setLineDash([10, 10]);
  strokeWeight(3);
  stroke('white')
  line(150,90,150,250);
  
  // Draw player 1
  drawingContext.setLineDash([]);
  strokeWeight(1);
  fill('white');
  rect(25,gameData.py,5,30)
  
  
  // Draw player 2
  drawingContext.setLineDash([]);
  strokeWeight(1);
  fill('white');
  rect(270,gameData.my,5,30)
  
  
  // Move Player 1
  if (keyIsDown(87) && (gameData.py - 1 >= 92))
    gameData.py--;
  if (keyIsDown(83) && (gameData.py + 1 <= 208))
    gameData.py++;
  
  
  // Move Player 2
  if (keyIsDown(UP_ARROW) && (gameData.my - 1 >= 92))
    gameData.my--;
  if (keyIsDown(DOWN_ARROW) && (gameData.my + 1 <= 208))
    gameData.my++;
  
  var speed = 0.05;
  
  // Player 1 colission
  var ball = {x: gameData.bx + gameData.dx,y: gameData.by + gameData.dy, w: 2, h: 10};
  if (Colision(ball, {x: 0,y: gameData.py, w: 30, h: 10})) {
    gameData.dx = Math.abs(gameData.dx) + speed;
    gameData.dy = -Random(0.75, 1, true)
      console.log(gameData.dx)
  }
  if (Colision(ball, {x: 0,y: gameData.py + 10, w: 30, h: 10})){
    gameData.dx = Math.abs(gameData.dx) + speed;
      console.log(gameData.dx)
  }
  if (Colision(ball, {x: 0,y: gameData.py + 20, w: 30, h: 10})) {
    gameData.dx = Math.abs(gameData.dx) + speed;
    gameData.dy = Random(0.75, 1, true)
      console.log(gameData.dx)
  }
  
  // Player 2 colission
  var ball = {x: gameData.bx + gameData.dx + 8,y: gameData.by + gameData.dy, w: 2, h: 10};
  if (Colision(ball, {x: 270,y: gameData.my, w: 30, h: 10})) {
    gameData.dx = -Math.abs(gameData.dx) - speed;
    gameData.dy = -Random(0.75, 1, true)
      console.log(gameData.dx)
  }
  if (Colision(ball, {x: 270,y: gameData.my + 10, w: 30, h: 10})){
    gameData.dx = -Math.abs(gameData.dx) - speed;
      console.log(gameData.dx)
  }
  if (Colision(ball, {x: 270,y: gameData.my + 20, w: 30, h: 10})) {
    gameData.dx = -Math.abs(gameData.dx) - speed;
    gameData.dy = Random(0.75, 1, true)
      console.log(gameData.dx)
  }
  
  var ball = {x: gameData.bx, y: gameData.by, w: 10, h: 10};
  if (Colision(ball, {x:10,y:90,w:5,h:150})) {
    gameData.bx = 150
    gameData.by = 165
    gameData.mp++
    gameData.dx = (Math.abs(gameData.dx) + 0.75 ) / 2
  }
  if (Colision(ball, {x:283,y:90,w:5,h:150})) {
    gameData.bx = 150
    gameData.by = 165
    gameData.pp++
    gameData.dx = -(Math.abs(gameData.dx) + 0.75 ) / 2
  }
  
  if (gameData.by + gameData.dy <= 90 || gameData.by + gameData.dy >= 230)
    gameData.dy = -gameData.dy;
  
  gameData.bx += gameData.dx;
  gameData.by += gameData.dy;
  
  fill('white');
  image(img.digibyte[0], gameData.bx, gameData.by, 10, 10)
  
  if (gameData.pp >= 10) {
    gameState = 'win1';
    gameData = {
      py: 155,
      my: 155,
      pp: 0,
      mp: 0,
      bx: 150,
      by: 165,
      dx: Random(0, 2) == 1? 1 : -1,
      dy: Math.random() * (Random(0, 2) == 0 ? -1 : 1)
    }
  } else if (gameData.mp >= 10) {
    gameState = 'win2';
    gameData = {
      py: 155,
      my: 155,
      pp: 0,
      mp: 0,
      bx: 150,
      by: 165,
      dx: Random(0, 2) == 1? 1 : -1,
      dy: Math.random() * (Random(0, 2) == 0 ? -1 : 1)
    }
  }
}

