function draw() {
  switch(gameState) {
      case 'start': start(); break;
      case 'game':  game(); break;
      case 'win1': win1(); break;
      case 'win2': win2(); break;
      case 'credits': credits(); break;
      case 'instructions': instructions(); break;
  }
}